import React, { useState, useEffect } from 'react';

import axios from 'axios';

interface UserDetails {
    Name: string;
    email: string;
}

const Dashboard: React.FC = () => {
    const [userDetails, setUserDetails] = useState<UserDetails | null>(null);

    useEffect(() => {
        const authenticatedUserEmail = 'user@example.com'; // Replace with your authentication logic to get the user's email dynamically

        axios.get<UserDetails>('http://localhost:8085/userDetails', {
            params: {
                email: authenticatedUserEmail
            }
        })
        .then(response => {
            setUserDetails(response.data);
        })
        .catch(error => {
            console.log(error);
        });
    }, []);

    if (!userDetails) {
        return <div>Loading...</div>;
    }

    return (
        <div className="dashboard-container">
            <h1>Welcome to your Dashboard, {userDetails.Name}</h1>
            <div>
                <p>Email: {userDetails.email}</p>
            </div>
        </div>
    );
}

export default Dashboard;
